import { Box } from '@chakra-ui/react'
import React from 'react'
import Whatis from './Whatis'
import WhyInvest from './WhyInvest'

function ExploreInvestment() {
  return (
     <Box>
        <WhyInvest/>
        <Whatis/>
     </Box>
  )
}

export default ExploreInvestment
